function ProfileCard({  title, handle, img }) {
	return (
		<div className="profile-card">
			<img img={img} alt={title} />
			<h5>Title is {title}</h5>
			<p>Handle is {handle}</p>
		</div>
	); 
}

export default ProfileCard;
